import React, {useState,useEffect} from "react"
import '../css/home.css';

const Home = (props) =>{


    return(
        <div>
            {(props.accountInfo === 1) ? <h1>Not Authenticated</h1> : <h1>authenticated</h1>}
        </div>
    )
}

export default Home;
